<script src="https://cdn.jsdelivr.net/npm/chart.js"></script>
<script src="https://cdn.jsdelivr.net/npm/chartjs-adapter-date-fns"></script>
<script>
document.addEventListener('DOMContentLoaded', function () {
	const ctxRating = document.getElementById('ratingChart').getContext('2d');
	let ratingChart;

	function fetchRatingData(filterType = 'month') {
		const formData = new FormData();
		formData.append('action', 'getRating');
		formData.append('filter_type', filterType);

		fetch('<?php echo admin_url("admin-ajax.php"); ?>', {
			method: 'POST',
			body: formData
		})
		.then(res => res.json())
		.then(data => {
			if (data.success) {
				const ratings = data.data.ratings_data;
				const labels = Object.keys(ratings).sort((a, b) => b - a); // ['5', '4', '3', ...]
				const values = labels.map(label => ratings[label]);

				updateRatingChart(labels, values);
			}
		})
		.catch(err => console.error(err));
	}

	function updateRatingChart(labels, values) {
		if (ratingChart) {
			ratingChart.destroy();
		}

		ratingChart = new Chart(ctxRating, {
			type: 'bar', // або 'doughnut'
			data: {
				labels: labels.map(r => `★ ${r}`),
				datasets: [{
					label: 'Кількість оцінок',
					data: values,
					backgroundColor: '#60a5fa',
					borderRadius: 4
				}]
			},
			options: {
				responsive: true,
				scales: {
					y: {
						beginAtZero: true,
						title: {
							display: true,
							text: 'Кількість'
						}
					}
				},
				plugins: {
					legend: {
						display: false
					}
				}
			}
		});
	}

	// initial load
	fetchRatingData('month');
});
</script>





















